import React from 'react';
import './Widget.css';

const Widget = (props) => (
  <div className="widget-outer">
    <div className="widget-inner">
      <img className='widget-image' src={props.image} alt={props.alt}/>
      <h4>{props.question}</h4>
      <input />
      {props.previousExists ? <button>previous</button> : ''}
      {props.isLast ? <button>next</button> : <button>complete</button>}
    </div>
  </div>
);

export default Widget
